wxStatusBar* Value_wxPropertyGrid::EntityT::GetStatusBar()
{
	static const Symbol* pSymbolFunc = nullptr;
	if (!pSymbolFunc) pSymbolFunc = Symbol::Add("GetStatusBar");
	do {
		Gurax::Function* pFunc_gurax;
		RefPtr<Gurax::Argument> pArgument_gurax;
		if (!core_gurax.PrepareOverrideMethod(pSymbolFunc, &pFunc_gurax, pArgument_gurax)) break;
		// Argument
		// (none)
		// Evaluation
		RefPtr<Value> pValueRtn(pFunc_gurax->Eval(core_gurax.GetProcessor(), *pArgument_gurax));
		if (Error::IsIssued()) {
			Util::ExitMainLoop();
			break;
		}
		// Return Value
		if (!pValueRtn->IsInstanceOf(VTYPE_wxStatusBar)) {
			Error::IssueWith(ErrorType::TypeError, pFunc_gurax->GetDeclCallable().GetExprSrc(),
				"the function GetStatusBar is expected to return a value of %s or its derived class",
				VTYPE_wxStatusBar.MakeFullName().c_str());
			Util::ExitMainLoop();
			break;
		}
		return Value_wxStatusBar::GetEntityPtr(*pValueRtn);
	} while (0);
	return public_GetStatusBar();
}

